import React from "react";

const DailyForecast = (props) => {
    return (
        <div className="days_forecast">
            <div className={props.state ? 'day_weather dark_mode_right_card' : 'day_weather'}>
                <h5 className="day">{props.day}</h5>
                <div className="day_icon"><img src={`http://openweathermap.org/img/wn/${props.icon}.png`} alt="icon"/></div>
                <h5 className="day_temp">{`${Math.round(props.temp)}°C`}</h5>
            </div>
        </div>
    )
}

export default DailyForecast
